  function mintur_style ($content, $title) {
    $html = '<html>';
    $html .= '   <head>';
    $html .= '      <style>';
    // Define the margins of your page URLD
    $html .= '         @page { margin: 0px 0px 0px 0px;}';
    $html .= '         header { position: fixed; top: 0px; left: 0px; right: 0px; height: 300px; z-index: -1;}';
    $html .= '         footer { position: fixed; bottom: 0px; left: 0px; right: 0px; background-color: #999999; text-align: center; height: 175px; z-index: -1;}';
    $html .= '         fondo { position: fixed; top:0px; left:0px; right:0px; z-index: -1;}';
    $html .= '         p { position: fixed; top: 325px; left:150px; right: 100px; bottom: 200px; page-break-after: always; z-index: 1;}';
    $html .= '         p:last-child { position: fixed; top: 325px; left:150px; right: 100px; bottom: 200px; page-break-after: never; z-index: 1;}';
    $html .= '      </style>';
    $html .= '   </head>';
    $html .= '   <body>';
    $html .= '      <fondo>';
    $html .= '         <img style="width: 100%; height:100%; z-index: -1;" src="data:image/png;base64,"/>';
    $html .= '      </fondo>';
    $html .= '      <header>';
    $html .= '         <img style=" margin-left: 100px; margin-top: 50px; height: 100px; " src="data:image/png;base64,"/>';
    $html .= '         <h2 style="width:100%; margin-top: 25px; font-family: Arial, Helvetica, sans-serif; text-align:center;">MINISTERIO DE TURISMO DEL ECUADOR</h2>';
    $html .= '         <h2 style="width:100%; margin-top: 25px; font-family: Arial, Helvetica, sans-serif; text-align:center; background-color: #999999; color: white">'. $title .'</h2>';
    $html .= '      </header>';
    $html .= '      <footer>';
    $html .= '         <img style="height:10px; width:100%;" src="data:image/png;base64,"/>';
    $html .= '         <img style="height:100px; width:auto; margin-top: 25px; margin-bottom:25px;" src="data:image/png;base64,"/>';
    $html .= '      </footer>';
    $html .= '      <main>';
    $html .= $content;
    $html .= '      </main>';
    $html .= '   </body>';
    $html .= '</html>';
    return $html;
  }

  function pdf_file(Request $data) {
    $request = $data->json()->all();
    $html_content = $request['html'];
    $title = $request['title'];
    $html = $this->mintur_style($html_content, $title);
    $orientation = $request['orientation'];
    $pdf = App::make('dompdf.wrapper');
    $pdf->setPaper('A4', $orientation);
    $pdf->setOptions(['dpi' => 150, 'defaultFont' => 'courier']);
    $pdf->loadHTML($html);
    $bytes = $pdf->output();
    $toReturn = base64_encode($bytes);
    return response()->json($toReturn, 200);
  }

